import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';
import Form from './components/Form';
import Parse from 'parse';

class App extends Component {

  constructor(props){
    super(props);
    this.state = {result: ''};
  }

  teste(){
    var Parse = require('parse');
    alert(Parse.Object);
  }

  componentWillMount(){
    Parse.serverURL = 'http://localhost:1337/parse';
    Parse.initialize('OSGiFZBrXxNLjN3gYDPsgi7P4a0j6fzcc2iaCKga', 'k8xm42UVuIP51wR2DswLY8NL3zgWfev8AuKUUjga');
    let install = new Parse .  Installation ();
    install .  set ( "deviceType" , navigator . userAgent );
    install .  save ().  then (( resp ) => {
      console .  log ( 'Created install object' , resp );

      this .  setState ({
        result : 'New object created with objectId: ' + resp .  id
      })
    }, err => {
      console .  log ( 'Error creating install object' , err );

      this .  setState ({
        result : 'Failed to create new object, with error code: ' + err .  message
      })
    });
    console.log(Parse.Object);
  }

  render() {
    return (
      //<Form teste={this.teste}/>
      <div className="App">
        <header className="App-header">
          <p>{this.state.result}</p>
        </header>
      </div>
    );
  }
}

export default App;
